import React, {Component} from 'react';
  
class ToDo extends Component {
    
    state={ };

    render() {
        return (
        <div className="card m-5">
            <div className="card-body">
                <div className="row">
                    <div className="col-6">
                         <span class="input-group-addon">Text</span>
                         <input  id="msg" placeholder="Additional Info" type="text" class="form-control" name="msg" className="form-control"></input>   
                    </div>
               </div>
           </div>
        </div>
        );
    }
}

export default ToDo;
